import {
  repeaterData,
  RepeaterControl,
} from '../../../gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText,InspectorControls } = wp.blockEditor;

const {
  PanelBody,
  PanelRow,
  ToggleControl,
  TextControl,
  TextareaControl,
  RadioControl,
} = wp.components;

const name = "gb/splittwotone";

registerBlockType(name, {
  title: __("Split Two Tone", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "contact",
  attributes: {
    method: {
      type: "string",
      default: "GET",
    },
    action: {
      type: "string",
      default: "",
    },
    message: {
      type: "string",
      default: "",
    },
    subject: {
      type: "string",
      default: "",
    },
    to: {
      type: "string",
      default: "",
    },
    hidden: {
      type: "string|array",
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentUJ: { type: "string", default: `` },
    contentUA: { type: "string", default: `Get in touch` },
    contentUB: {
      type: "string",
      default: `Nullam risus blandit ac aliquam justo ipsum. Quam mauris volutpat massa dictumst amet. Sapien tortor lacus arcu.`,
    },
    contentUC: { type: "string", default: `Postal address` },
    contentUD: { type: "string", default: `Phone number` },
    contentUE: { type: "string", default: ` +1 (555) 123-4567 ` },
    contentUF: { type: "string", default: `Email` },
    contentUG: { type: "string", default: ` support@example.com ` },
    contentUH: { type: "string", default: `View all job openings` },
    contentUI: { type: "string", default: `Full name` },
    contentt: { type: "string", default: `Email` },
    contentUK: { type: "string", default: `Phone` },
    contentUL: { type: "string", default: `Message` },
    contentUN: { type: "string", default: `Submit` },
    contentUO: { type: "string", default: `Looking for careers?` },
    contentUZ: { type: "string", default: `742 Evergreen Terrace<br>Springfield, OR 12345` },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const { send } = attributes;

    return (
      <div className="relative bg-white">
         <InspectorControls>
          <PanelBody title="Menus">
              { availableMenus.map(function(k) {        

                  return <PanelRow>
                            <CheckboxControl

                              label={ k.name }
                              value={k.id}
                              checked={menus.includes(k.id)}
                              onChange={ () => handleChangeGroup(k.id)}
                            />
                          
                          </PanelRow>
                         
                })}           
            
          </PanelBody>
          <PanelBody title="Email settings">
            <PanelRow>
              <ToggleControl
                label="Send email"
                checked={send}
                onChange={() => setAttributes({ send: !send })}
              />
            </PanelRow>
            {send ? (
              <div>
                <PanelRow>
                  <TextControl
                    label="To"
                    value={attributes.to}
                    onChange={(to) => setAttributes({to})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextControl
                    label="Subject"
                    value={attributes.subject}
                    onChange={(subject) => setAttributes({subject})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextareaControl
                    label="Message"
                    value={attributes.message}
                    onChange={(message) => setAttributes({message})}
                  />
                </PanelRow>
              </div>
            ) : (
              ""
            )}
          </PanelBody>
          <PanelBody title="Form settings">
            <PanelRow>
              <RadioControl
                label="Method"
                selected={attributes.method}
                options={[
                  { label: "GET", value: "GET" },
                  { label: "POST", value: "POST" },
                ]}
                onChange={(method) => setAttributes({ method })}
              />
            </PanelRow>
            <PanelRow>
              <TextControl
                label="Action"
                onChange={(action) => setAttributes({ action })}
              />
            </PanelRow>

            <PanelRow>
              <b>Hidden fields</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={5}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Name"
                      value={value.name}
                      onChange={(v) => {
                        value.name = v;
                        onChange(value);
                      }}
                    />,
                    <TextControl
                      label="Value"
                      value={value.val}
                      onChange={(v) => {
                        value.val = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>

        <div className="absolute inset-0">
          
          <div className="absolute inset-y-0 left-0 w-1/2 bg-gray-50">
            <RichText
              value={attributes.contentUJ}
              default={""}
              onChange={(newtext) => setAttributes({ contentUJ: newtext })}
            />
          </div>
        </div>
        <div className="relative max-w-7xl mx-auto lg:grid lg:grid-cols-5">
          
          <div className="bg-gray-50 py-16 px-4 sm:px-6 lg:col-span-2 lg:px-8 lg:py-24 xl:pr-12">
            
            <div className="max-w-lg mx-auto">
              
              <h2 className="text-2xl font-extrabold tracking-tight text-gray-900 sm:text-3xl">
                <RichText
                  value={attributes.contentUA}
                  default={"Get in touch"}
                  onChange={(newtext) =>
                    setAttributes({ contentUA: newtext })
                  }
                />
              </h2>
              <p className="mt-3 text-lg leading-6 text-gray-500">
                <RichText
                  value={attributes.contentUB}
                  default={
                    "Nullam risus blandit ac aliquam justo ipsum. Quam mauris volutpat massa dictumst amet. Sapien tortor lacus arcu."
                  }
                  onChange={(newtext) =>
                    setAttributes({ contentUB: newtext })
                  }
                />
              </p>
              <dl className="mt-8 text-base text-gray-500">
                
                <div>
                  
                  <dt className="sr-only">
                    <RichText
                      value={attributes.contentUC}
                      default={"Postal address"}
                      onChange={(newtext) =>
                        setAttributes({ contentUC: newtext })
                      }
                    />
                  </dt>
                  <dd>
                    
                    <p><RichText
                      value={attributes.contentUZ}
                      default={"742 Evergreen Terrace<br>Springfield, OR 12345"}
                      onChange={(newtext) =>
                        setAttributes({ contentUZ: newtext })
                      }
                    /></p>
                  </dd>
                </div>
                <div className="mt-6">
                  
                  <dt className="sr-only">
                    <RichText
                      value={attributes.contentUD}
                      default={"Phone number"}
                      onChange={(newtext) =>
                        setAttributes({ contentUD: newtext })
                      }
                    />
                  </dt>
                  <dd className="flex">
                    
                    <svg
                      className="flex-shrink-0 h-6 w-6 text-gray-400"
                      xmlns="http://www.w3.org/2000/svg"
                      fill="none"
                      viewBox="0 0 24 24"
                      stroke="currentColor"
                      aria-hidden="true"
                    >
                      
                      <path
                        stroke-linecap="round"
                        stroke-linejoin="round"
                        stroke-width="2"
                        d="M3 5a2 2 0 012-2h3.28a1 1 0 01.948.684l1.498 4.493a1 1 0 01-.502 1.21l-2.257 1.13a11.042 11.042 0 005.516 5.516l1.13-2.257a1 1 0 011.21-.502l4.493 1.498a1 1 0 01.684.949V19a2 2 0 01-2 2h-1C9.716 21 3 14.284 3 6V5z"
                      />
                    </svg>
                    <span className="ml-3">
                      <RichText
                        value={attributes.contentUE}
                        default={" +1 (555) 123-4567 "}
                        onChange={(newtext) =>
                          setAttributes({ contentUE: newtext })
                        }
                      />
                    </span>
                  </dd>
                </div>
                <div className="mt-3">
                  
                  <dt className="sr-only">
                    <RichText
                      value={attributes.contentUF}
                      default={"Email"}
                      onChange={(newtext) =>
                        setAttributes({ contentUF: newtext })
                      }
                    />
                  </dt>
                  <dd className="flex">
                    
                    <svg
                      className="flex-shrink-0 h-6 w-6 text-gray-400"
                      xmlns="http://www.w3.org/2000/svg"
                      fill="none"
                      viewBox="0 0 24 24"
                      stroke="currentColor"
                      aria-hidden="true"
                    >
                      
                      <path
                        stroke-linecap="round"
                        stroke-linejoin="round"
                        stroke-width="2"
                        d="M3 8l7.89 5.26a2 2 0 002.22 0L21 8M5 19h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v10a2 2 0 002 2z"
                      />
                    </svg>
                    <span className="ml-3">
                      <RichText
                        value={attributes.contentUG}
                        default={" support@example.com "}
                        onChange={(newtext) =>
                          setAttributes({ contentUG: newtext })
                        }
                      />
                    </span>
                  </dd>
                </div>
              </dl>
              <p className="mt-6 text-base text-gray-500">
                <RichText
                  value={attributes.contentUO}
                  default={"Looking for careers?"}
                  onChange={(newtext) =>
                    setAttributes({ contentUO: newtext })
                  }
                />
                <a href="#" className="font-medium text-gray-700 underline">
                  <RichText
                    value={attributes.contentUH}
                    default={"View all job openings"}
                    onChange={(newtext) =>
                      setAttributes({ contentUH: newtext })
                    }
                  />
                </a>
                .
              </p>
            </div>
          </div>
          <div className="bg-white py-16 px-4 sm:px-6 lg:col-span-3 lg:py-24 lg:px-8 xl:pl-12">
            
            <div className="max-w-lg mx-auto lg:max-w-none">
              
              <form
                action="#"
                method="POST"
                className="grid grid-cols-1 gap-y-6"
              >
                
                <div>
                  
                  <label for="full-name" className="sr-only">
                    <RichText
                      value={attributes.contentUI}
                      default={"Full name"}
                      onChange={(newtext) =>
                        setAttributes({ contentUI: newtext })
                      }
                    />
                  </label>
                  <input
                    type="text"
                    name="full-name"
                    id="full-name"
                    autocomplete="name"
                    className="block w-full shadow-sm py-3 px-4 placeholder-gray-500 focus:ring-indigo-500 focus:border-indigo-500 border-gray-300 rounded-md"
                    placeholder="Full name"
                  />
                </div>
                <div>
                  
                  <label for="email" className="sr-only">
                    <RichText
                      value={attributes.contentt}
                      default={"Email"}
                      onChange={(newtext) =>
                        setAttributes({ contentt: newtext })
                      }
                    />
                  </label>
                  <input
                    id="email"
                    name="email"
                    type="email"
                    autocomplete="email"
                    className="block w-full shadow-sm py-3 px-4 placeholder-gray-500 focus:ring-indigo-500 focus:border-indigo-500 border-gray-300 rounded-md"
                    placeholder="Email"
                  />
                </div>
                <div>
                  
                  <label for="phone" className="sr-only">
                    <RichText
                      value={attributes.contentUK}
                      default={"Phone"}
                      onChange={(newtext) =>
                        setAttributes({ contentUK: newtext })
                      }
                    />
                  </label>
                  <input
                    type="text"
                    name="phone"
                    id="phone"
                    autocomplete="tel"
                    className="block w-full shadow-sm py-3 px-4 placeholder-gray-500 focus:ring-indigo-500 focus:border-indigo-500 border-gray-300 rounded-md"
                    placeholder="Phone"
                  />
                </div>
                <div>
                  
                  <label for="message" className="sr-only">
                    <RichText
                      value={attributes.contentUL}
                      default={"Message"}
                      onChange={(newtext) =>
                        setAttributes({ contentUL: newtext })
                      }
                    />
                  </label>
                  <textarea
                    id="message"
                    name="message"
                    rows="4"
                    className="block w-full shadow-sm py-3 px-4 placeholder-gray-500 focus:ring-indigo-500 focus:border-indigo-500 border border-gray-300 rounded-md"
                    placeholder="Message"
                  ></textarea>
                </div>
                <div>
                  
                  <button
                    type="submit"
                    className="inline-flex justify-center py-3 px-6 border border-transparent shadow-sm text-base font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                  >
                    <RichText
                      value={attributes.contentUN}
                      default={"Submit"}
                      onChange={(newtext) =>
                        setAttributes({ contentUN: newtext })
                      }
                    />
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div class="relative bg-white">
        
        <div class="absolute inset-0">
          
          <div class="absolute inset-y-0 left-0 w-1/2 bg-gray-50">
           <RichText.Content value={attributes.contentUJ}/>
          </div>
        </div>
        <div class="relative max-w-7xl mx-auto lg:grid lg:grid-cols-5">
          
          <div class="bg-gray-50 py-16 px-4 sm:px-6 lg:col-span-2 lg:px-8 lg:py-24 xl:pr-12">
            
            <div class="max-w-lg mx-auto">
              
              <h2 class="text-2xl font-extrabold tracking-tight text-gray-900 sm:text-3xl">
               <RichText.Content value={attributes.contentUA}/>
              </h2>
              <p class="mt-3 text-lg leading-6 text-gray-500">
               <RichText.Content value={attributes.contentUB}/>
              </p>
              <dl class="mt-8 text-base text-gray-500">
                
                <div>
                  
                  <dt class="sr-only">{attributes.contentUC}</dt>
                  <dd>
                    
                    <p><RichText.Content value={attributes.contentUZ} /></p>
                  </dd>
                </div>
                <div class="mt-6">
                  
                  <dt class="sr-only">{attributes.contentUD}</dt>
                  <dd class="flex">
                    
                    <svg
                      class="flex-shrink-0 h-6 w-6 text-gray-400"
                      xmlns="http://www.w3.org/2000/svg"
                      fill="none"
                      viewBox="0 0 24 24"
                      stroke="currentColor"
                      aria-hidden="true"
                    >
                      
                      <path
                        stroke-linecap="round"
                        stroke-linejoin="round"
                        stroke-width="2"
                        d="M3 5a2 2 0 012-2h3.28a1 1 0 01.948.684l1.498 4.493a1 1 0 01-.502 1.21l-2.257 1.13a11.042 11.042 0 005.516 5.516l1.13-2.257a1 1 0 011.21-.502l4.493 1.498a1 1 0 01.684.949V19a2 2 0 01-2 2h-1C9.716 21 3 14.284 3 6V5z"
                      />
                    </svg>
                    <span class="ml-3">{attributes.contentUE}</span>
                  </dd>
                </div>
                <div class="mt-3">
                  
                  <dt class="sr-only">{attributes.contentUF}</dt>
                  <dd class="flex">
                    
                    <svg
                      class="flex-shrink-0 h-6 w-6 text-gray-400"
                      xmlns="http://www.w3.org/2000/svg"
                      fill="none"
                      viewBox="0 0 24 24"
                      stroke="currentColor"
                      aria-hidden="true"
                    >
                      
                      <path
                        stroke-linecap="round"
                        stroke-linejoin="round"
                        stroke-width="2"
                        d="M3 8l7.89 5.26a2 2 0 002.22 0L21 8M5 19h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v10a2 2 0 002 2z"
                      />
                    </svg>
                    <span class="ml-3">{attributes.contentUG}</span>
                  </dd>
                </div>
              </dl>
              <p class="mt-6 text-base text-gray-500">
                <RichText.Content value={attributes.contentUO} />
                <a
                  href={
                    attributes.contentUH.match('(.*?)href="(.*?)"(.*?)')
                      ? attributes.contentUH.match(
                          '(.*?)href="(.*?)"(.*?)'
                        )[2]
                      : attributes.contentUH
                  }
                  class="font-medium text-gray-700 underline"
                >
                  {attributes.contentUH.match("(?<=<.+.>)(.*?)(?=<.*/.+.?>)")
                    ? attributes.contentUH.match(
                        "(?<=<.+.>)(.*?)(?=<.*/.+.?>)"
                      )[0]
                    : attributes.contentUH}
                </a>
                .
              </p>
            </div>
          </div>
          <div class="bg-white py-16 px-4 sm:px-6 lg:col-span-3 lg:py-24 lg:px-8 xl:pl-12">
            
            <div class="max-w-lg mx-auto lg:max-w-none">
              
              <form 
                action={attributes.action}
                method={attributes.method}
                class="grid grid-cols-1 gap-y-6">
                
                <div>
                  {arData.map((v) => {
                    return <input type="hidden" name={v.name} value={v.val} />;
                  })}
                  
                  <label for="full-name" class="sr-only">
                   <RichText.Content value={attributes.contentUI}/>
                  </label>
                  <input
                    type="text"
                    name="full-name"
                    id="full-name"
                    autocomplete="name"
                    class="block w-full shadow-sm py-3 px-4 placeholder-gray-500 focus:ring-indigo-500 focus:border-indigo-500 border-gray-300 rounded-md"
                    placeholder="Full name"
                  />
                </div>
                <div>
                  
                  <label for="email" class="sr-only">
                   <RichText.Content value={attributes.contentt}/>
                  </label>
                  <input
                    id="email"
                    name="email"
                    type="email"
                    autocomplete="email"
                    class="block w-full shadow-sm py-3 px-4 placeholder-gray-500 focus:ring-indigo-500 focus:border-indigo-500 border-gray-300 rounded-md"
                    placeholder="Email"
                  />
                </div>
                <div>
                  
                  <label for="phone" class="sr-only">
                   <RichText.Content value={attributes.contentUK}/>
                  </label>
                  <input
                    type="text"
                    name="phone"
                    id="phone"
                    autocomplete="tel"
                    class="block w-full shadow-sm py-3 px-4 placeholder-gray-500 focus:ring-indigo-500 focus:border-indigo-500 border-gray-300 rounded-md"
                    placeholder="Phone"
                  />
                </div>
                <div>
                  
                  <label for="message" class="sr-only">
                   <RichText.Content value={attributes.contentUL}/>
                  </label>
                  <textarea
                    id="message"
                    name="message"
                    rows="4"
                    class="block w-full shadow-sm py-3 px-4 placeholder-gray-500 focus:ring-indigo-500 focus:border-indigo-500 border border-gray-300 rounded-md"
                    placeholder="Message"
                  ></textarea>
                </div>
                <div>
                  
                  <button
                    type="submit"
                    onclick={`sendEmail('${name}'); return false;`}
                    class="inline-flex justify-center py-3 px-6 border border-transparent shadow-sm text-base font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                  >
                   <RichText.Content value={attributes.contentUN}/>
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    );
  },
});
